import org.apache.poi.ss.usermodel.WorkbookFactory;
import org.apache.poi.ss.util.*;
import org.apache.poi.ss.usermodel.*;

def filePath = context.expand('${#TestSuite#FilePath}')
def workSheet = context.expand('${#TestSuite#WorkSheet}')

//opens test data sheet
Workbook workbook = WorkbookFactory.create(new FileInputStream(filePath))
Sheet sheet = workbook.getSheet(workSheet);

//Retrieving Row and Column count from Properties
def propertiesStep = context.testCase.getTestStepByName("Pro_Properties")
def rSPPropertiesStep = context.testCase.getTestStepByName("Rsp_Properties")
def int totalRows = context.expand('${#TestCase#Dso_TotalRows}').toInteger()
def int totalColumns = context.expand('${#TestCase#Dso_TotalColumns}').toInteger()
def int rowIndex = context.expand('${#TestCase#Dso_RowIndex}').toInteger()

//Reading data from data sheet

for (i=0; i<totalColumns; i++)
{

                if (sheet.getRow(rowIndex) == null)
                {
                                testRunner.gotoStepByName("Exit");
                }else if(sheet.getRow(0).getCell(i).toString().contains("RSP_"))
                {
                	rSPPropertiesStep.setPropertyValue(sheet.getRow(0).getCell(i).toString()," ")
                }
                else 
                {
                     propertiesStep.setPropertyValue(sheet.getRow(0).getCell(i).toString(),sheet.getRow(rowIndex).getCell(i).toString())
                }
}



++rowIndex
log.info("Row Index = "+rowIndex)
context.testCase.setPropertyValue("Dso_RowIndex", rowIndex.toString())

