import java.util.Arrays;

def exp_PropertiesStep = context.testCase.getTestStepByName("Pro_Properties")
def rsp_PropertiesStep = context.testCase.getTestStepByName("Rsp_Properties")

def dataSource_Array = exp_PropertiesStep.getPropertyNames()
def properties_Array = rsp_PropertiesStep.getPropertyNames()

//log.info "dataSource_Array: "+dataSource_Array.toString()
//log.info "properties_Array: "+properties_Array.toString()

//------------------Obtaining Exp_ & Rsp_ properties array
def exp_PropertyArray = []
def rsp_PropertyArray = []
int j=0, k=0;
for(int i=0;i<dataSource_Array.size();i++)
{
	if(dataSource_Array[i].contains("Req_Exp_"))
	{
		exp_PropertyArray[j]=dataSource_Array[i]
		j++
	}
}
for(int i=0;i<properties_Array.size();i++)
{
	if(properties_Array[i].contains("RSP_"))
	{
		rsp_PropertyArray[k]=properties_Array[i]
		k++
	}
}
log.info "exp_PropertyArray: "+exp_PropertyArray.toString()
log.info "rsp_PropertyArray: "+rsp_PropertyArray.toString()

//----------------------------Validation Logic---------------------
def matchingCount = 0;
if(exp_PropertyArray.size() == rsp_PropertyArray.size())
{
	for(int i=0;i<exp_PropertyArray.size();i++)
	{
		def expectedValue = context.expand('${Pro_Properties#'+exp_PropertyArray[i]+'}').toUpperCase()
		def actualValue = context.expand('${Rsp_Properties#'+rsp_PropertyArray[i]+'}').toUpperCase()
		if(actualValue.contains(expectedValue))
		{
			matchingCount++;
		}
		else
		{
			log.info "expectedValue: "+expectedValue
			log.info "actualValue: "+actualValue
		}
	}
}
log.info "Matching Count: "+matchingCount.toString()

if(matchingCount == rsp_PropertyArray.size() && matchingCount == exp_PropertyArray.size())
{
	exp_PropertiesStep.setPropertyValue("Result","Pass")
}
else
{
	exp_PropertiesStep.setPropertyValue("Result","Fail")
}

log.info "Validation Result: "+context.expand('${Pro_Properties#Result}')

